import React from "react";

const Categorycard = ({ img, name }) => {
  return (
    <div>
      <div className="category-card d-flex flex-column mt-5">
        <div className="delete">
          <span style={{ paddingRight: "20px" }}>
            <i
              style={{ padding: "16px 6px", justifySelf: "end" }}
              class="fas fa-times text-white"
            ></i>
          </span>
        </div>
        <div className="img-block">
          <img src={img} alt="category" />
        </div>
        <div className="edit">
          <span>
            <i class="fas fa-pencil-alt"></i>
          </span>
        </div>
      </div>
      <div className="category-name mt-4">
        <p>{name}</p>
      </div>
    </div>
  );
};

export default Categorycard;
